import React from 'react';
import ProfileUi from 'react-profile-card';


function Example() {
  return (
    <div> 
      <ProfileUi 
          imgUrl='https://scontent-bom1-1.cdninstagram.com/v/t51.2885-19/s320x320/164307178_873313356844922_4199747748443954198_n.jpg?tp=1&_nc_ht=scontent-bom1-1.cdninstagram.com&_nc_ohc=JMb9_QjFq_oAX8TqAZo&ccb=7-4&oh=443e71ef663a956cf158cda20ce0d907&oe=6088835F&_nc_sid=7bff83' 
          name='Nikhil' 
          designation='Kidney Patient' 
          />
    </div>
  );
}

export default Example;
